import SearchBar from "../searchBar/SearchBar"
import logo from './logo.png'

const Nav=(props)=>{
    return(
        <nav>
            <img src={logo} alt='logo rick and morty' />
            <SearchBar onSearch={(characterID) => window.alert(characterID)}/>
        </nav>
    )
}

export default Nav
